import './_home.scss';
import backgroundImage from "./gradient.jpeg";

const containerStyle = {
    backgroundImage: `url(${backgroundImage})`,
    backgroundSize: "cover",
    backgroundRepeat: "no-repeat",
    backgroundPosition: "center",
    minHeight: "100vh", // Ensures the image covers the entire viewport height
  };

  function MyComponent() {
    return (
      <div style={containerStyle}>
        {/* Your content goes here */}
      </div>
    );
  }


function Home() {
  return (
    <div className="home">
      <header>
        <h1>Welcome to My Website</h1>
        <p>A simple and nice homepage</p>
      </header>
      <main>
        <section className="content">
          <h2>About Me</h2>
          <p>
          In this website we check your knowledge on music
          </p>
        </section>
      </main>
      <footer>
        <p>&copy; 2023 Music hackathon Website</p>
      </footer>
    </div>
  );
}



export default Home;
